import Icon from "./Icon"

const FAQS = () => {
    return (
        <div>
            <div className="faqs-box">
                <div className= "faqs">
                FAQs
                </div>
                <div className= "faqs-below">
                Got Questions? We have got answers!
                </div>
                <div className= "faqs-des">
                We have compiled a short list of the questions we are asked most frequently by our clients, our FAQs. If you don’t see the answer to your question here, please call us at (+91) 9163553305 ( Monday - Friday, 10AM - 9PM IST) or email us.
                </div>
            </div>
            <div className= "one">01</div>
            <div className= "line"></div>
            <div className= "one-quest">
            What are the services Spineor providing?
            </div>
            <div className= "one-ans">
            Spineor works with the organizations worldwide to provide them with software development and web development solutions and services. Broadly, we provide the following services :
            </div>
            <div className= "point-table">
                Mobile Application Development 
                <br/>
                iPhone Application Development 
                <br/>
                Web Development 
                <br/>
                Web Redesign and Maintenance 
                <br/>
                E-Commerce Solutions 
                <br/>
                E-commerce Website Design
                </div>
            <div className= "point-table2">
            E-commerce Web Development 
            <br/>
            Fullstack Web Development 
            <br/>
            Internet Marketing and SEO 
            <br/>
            Open Source Customization – Joomla, Drupal, Magento, OsCommerce etc
            </div>
            <div className= "two">02</div>
            <div className= "line2"></div>
            <div className= "two-quest">
            How can I communicate with Spineor?
            </div>
            <div className= "03"></div>
            <div className= "04"></div>
            <div className= "05"></div>
            <style jsx>{`

    .faqs-box {
        position: absolute;
        width: 1340px;
        height: 630px;
        left: 0px;
        top: 74px;
        background: #FFFFFF;
    }

    .faqs {
        position: absolute;
        width: 426px;
        height: 100px;
        left: 111px;
        top: 288px;
        font-family: Roboto;
        font-style: normal;
        font-weight: bold;
        font-size: 90px;
        line-height: 105px;
        color: #333333;
    }

    .faqs-below {
        position: absolute;
        width: 385px;
        height: 168px;
        left: 111px;
        top: 394px;
        font-family: Roboto;
        font-style: normal;
        font-weight: bold;
        font-size: 37px;
        line-height: 43px;
        color: #555555;
    }

    .faqs-des {
        position: absolute;
        width: 520px;
        height: 398px;
        left: 656px;
        top: 236px;
        font-family: Roboto;
        font-style: normal;
        font-weight: 300;
        font-size: 36px;
        line-height: 42px;
        color: #333333;
    }

    .one {
        position: absolute;
        width: 28px;
        height: 28px;
        left: 271px;
        top: 814px;
        font-family: Roboto;
        font-style: normal;
        font-weight: 900;
        font-size: 24px;
        line-height: 28px;
        color: #184A88;
    }

    .one-quest {
        position: absolute;
        width: 438px;
        height: 28px;
        left: 339px;
        top: 814px;
        font-family: Roboto;
        font-style: normal;
        font-weight: 500;
        font-size: 24px;
        line-height: 28px;
        color: #184A88;
    }

    .one-ans {
        position: absolute;
        width: 688px;
        height: 70px;
        left: 345px;
        top: 884px;
        font-family: Roboto;
        font-style: normal;
        font-weight: 300;
        font-size: 18px;
        line-height: 21px;
        color: #000000;
    }

    .point-table {
        position: absolute;
        width: 269px;
        height: 201px;
        left: 373px;
        top: 981px;
        font-family: Roboto;
        font-style: normal;
        font-weight: 300;
        font-size: 18px;
        line-height: 180.7%;
        color: #000000;
    }

    .point-table2 {
        position: absolute;
        width: 269px;
        height: 201px;
        left: 712px;
        top: 981px;
        font-family: Roboto;
        font-style: normal;
        font-weight: 300;
        font-size: 18px;
        line-height: 184%;
        color: #000000;
    }

    .line {
        position: absolute;
        width: 60px;
        height: 0px;
        left: 286px;
        top: 826px;
        border: 1px solid rgba(0, 0, 0, 0.26);
        transform: rotate(90deg);
    }

    .two {
        position: absolute;
        width: 28px;
        height: 28px;
        left: 271px;
        top: 1299px;     
        font-family: Roboto;
        font-style: normal;
        font-weight: 900;
        font-size: 24px;
        line-height: 28px;        
        color: #184A88;
    }

    .line2 {
        position: absolute;
        width: 60px;
        height: 0px;
        left: 286px;
        top: 1310px;
        border: 1px solid rgba(0, 0, 0, 0.26);
        transform: rotate(90deg);
    }

    .two-quest {
        position: absolute;
        width: 404px;
        height: 28px;
        left: 339px;
        top: 1299px;
        font-family: Roboto;
        font-style: normal;
        font-weight: 300;
        font-size: 24px;
        line-height: 28px;       
        color: #000000;
    }



    `}</style>
        </div>
    )
}
export default FAQS
